%[text] %[text:anchor:H_09dc] <u>Background and Terminology</u>
%[text] Recall: The objective of this section is to develop a data **parser** - in the case of the MNIST dataset, the parser's objective is to transform the raw data files into usable form.
%[text] As such, any pragmatic programmer will bake-in a `try, catch` block to "check" the data file's parameters for *adherence* to MNIST documentation.
%[text] - E.g., Is the file being read a *training image* file as expected? Does it have the expected size (\# of pixels)? And what is the quantity of training files? \
%[text] `machinefmt` - The argument used in the `fopen` function sets the order for reading bytes or bits in a file.
%[text] - Big-endian order refers to where the most significant byte (the "big end") is stored, or read, first. The most significant byte at the lowest address. \
imshow('big- v. little-endianness.png') %[output:4485b0fb]
imshow('32-bit_integer_format.png') %[output:703ef11b]
%[text] `try, catch` - statement
%[text] - For practice using this scheme, see 'Error\_Handling\_practice.mlx' \
%[text] `magicNumber` - For the MNIST dataset, the first four bytes of the *training-images-idx3-ubyte* file contain the magic number which has been set to `2051`.
imshow('magicNumber.png') %[output:15a5ae0c]
%%
% try, catch -- this statement is used for error handling, allows
% the execution of code (in the 'try' block) while catching and managing
% potential errors (in the 'catch' block). It prevents abrupt program
% termination and enables alternative actions when an error occurs, or an exception is thrown.

% TRY-CATCH block with multiple (4) ASSERT conditions and unique, value-embedded
% cause messages:
try %[output:group:4a9f6983]
    % Initalize base exception
    % syntax: baseException = MException(errID, msg)
    baseException = MException('Validation:HeaderCheckFailed', ...
        'One ore more header values failed validation.');
    % Set FOPEN function parameters
    permission = 'r'; % type of access to be used as input argument into the 'fopen' function; e.g., reading, writing, reading and writing, the 'r' opens the file for reading
    machinefmt = 'b'; % order for reading bytes in the file; 'b' designates Big-endian ordering, which according to Lum, MNIST documentation states data is stored in this format
    
    fileID = fopen(fileName, permission, machinefmt); % Opens the file
    %% Four 'elements' of the file will be run through this TRY block;
    %
    % 1. magicNumber is checked against 2051, which is the value of the
    % first 4 bits in the 32-bit integer for the TRAINING image files 
    % (the labels files' magic number is 2049).
    % 
    % 2. the next set of 4 bits contain the quantity of files, which should
    % be 60,000 image files.
    %
    % 3. the next set of 4 bits contain the number of rows, which should 
    % be 28, for a 28x28 pixel image.
    %
    % 4. then the next set of 4 bits contain the number of columns, which
    % again should be 28.
    %

    magicNumber = fread(fileID, 1, 'int32'); % Reads data from binary file into variable
    % 'magicNumber', and we are reading only one element / size '1' of class and size set
    % to 32-bit integer, signed.
    % Re: Use of the variable name 'magicNumber' -- referring to a literal
    % constant value that appears directly in code without explanation;
    % considered bad practice when it's unclear what the number represents,
    % since it is a mysterious value hardcoded into logic.

    numItems = fread(fileID, 1, 'int32');
    numRows = fread(fileID, 1, 'int32');
    numCols = fread(fileID, 1, 'int32');
    % **NOTE: Once one 32-bit integer is read from the file, the next call
    % to read a 32-bit integer reads the "next" 32-bit integer; this
    % is why the input arguments to the FREAD function remain the same for
    % the four elements, once one has been read, then the reader will read
    % the next, and so on.

    % Assertion 1: Magic Number
    try
        assert(magicNumber == 2051, ...
            'Validation:InvalidMagicNumber', ...
            ['Magic number mismatch: Expected 2051 for training image file, but received ', ...
            num2str(magicNumber), '.']);
    catch cause1
        baseException = addCause(baseException, cause1);
    end

    % Assertion 2: Number of Items
    try
        assert(numItems == 60000, ...
            'Validation:UnexpectedItemCount', ...
            ['Item count mismatch: Expected 60,000 images, but received ', ...
            num2str(numItems), '.']);
    catch cause2
        baseException = addCause(baseException, cause2);
    end

    % Assertion 3: Number of Rows
    try
        assert(numRows == 28, ...
            'Validation:InvalidRowDimension', ...
            ['Row dimension mismatch: Expected 28 pixels per image row, but received ', ...
            num2str(numRows), '.']);
    catch cause3
        baseException = addCause(baseException, cause3);
    end

    % Assertion 4: Number of Columns
    try
        assert(numCols == 28, ...
            'Validation:InvalidColumnDimension', ...
            ['Column dimension mismatch: Expected 28 pixels per image column, but received ', ...
            num2str(numCols), '.']);
    catch cause4
        baseException = addCause(baseException, cause4);
    end

    % Only throw if any assertion failed.
    if ~isempty(baseException.cause)
        throw(baseException);
    else
        disp('✅ All header values passed validation.'); %[output:6f6eddef]
    end

    % Diagnostics block to check all pixels are in the range of 0:255
    TrainingSetImages = uint8(zeros(numRows,numCols,numItems));
    for k = 1:numItems
        % Create an array A representing an image, where each element holds
        % the pixel value as an 8-byte unsigned integer.
        A = uint8(zeros(numRows,numCols)); % Initialize a ZEROS array of numRows x numCols, and store it as an 8-byte unsigned integer array
        for m = 1:numRows
            for n = 1:numCols
                A(m,n) = fread(fileID,1,'uint8');
            end
        end
        % Cycle through all images, creating a 3-D array, where each 2-D
        % array represents the pixel map for a single image.
        TrainingSetImages(:,:,k) = A; % The 2-D array, A, is appended to the 'TrainingSetImages' variable at every iteration, k, for 1:numItems (60,000 images!)

        if(mod(k,samplesBetweenDiagnostics)==0) % Use the MODULO OPERATION; when k = samplesBetweenDiagnostics, then the remainder after division is zero and thefore this triggers the "hard stop".
            disp([num2str(k/numItems*100), '% complete']) %[output:803a6c54]
        end
    end
    
    % Validate pixel intensity range
    % Assert that the max pixel value is less than or equal to 255 (max value of an 8-bit integer).
    assert(max(TrainingSetImages(:)) <= 255, ...
        'MNIST:PixelOverflow', ...
        ['Pixel intensity exceeds 8-bit range: Maximum value found was ', ...
        num2str(max(TrainingSetImages(:))), '. Expected maximum is 255.']);

    % Assert that the min pixel value is greater than or equal to 0.
    assert(min(TrainingSetImages(:)) >= 0, ...
        'MNIST:PixelUnderflow', ...
        ['Pixel intensity below 8-bit range: Minimum value found was ', ...
        num2str(min(TrainingSetImages(:))), '. Expected minimum is 0.']);

    % Throw exception if assertion fails.
    if ~isempty(baseException.cause)
        throw(baseException);
    else
        disp(['✅ All pixel values are within the valid range of 0 to 255, ...' ... %[output:981cc762]
        'which is the valid range of values for an unsigned 8-bit integer.']); %[output:981cc762]
    end
    % If both assertions pass, display confirmation
    %disp(['✅ All pixel values are within the valid range of 0 to 255, ...' ...
    %    'which is the valid range of values for an unsigned 8-bit integer.']);

    %assert(max(max(max(TrainingSetImages)))<=255); % Assert that the max pixel value is less than or equal to 255.
    %assert(min(min(min(TrainingSetImages)))>=0); % Assert that the min pixel value is greater than or equal to 0.
    % Note: Three min/max functions are called, since every min/max call
    % gets the min/max for a given column; calling min/max three times,
    % gets the min/max for entire 3D array.

    % Should add a display message indicating all files are within pixel
    % intensity limits if no exception is thrown.
    

    fclose(fileID);

catch ME
    % Display full error report, including all causes
    warning(ME.message)
    fclose(fileID);

    disp('❌ Validation Error Encountered:');
    disp(getReport(ME, 'extended'));
end %[output:group:4a9f6983]
% (I LOVE COPILOT!!)
%%
%[text] #### Training Set Labels
% *Training Set Labels* %[text:anchor:TMP_6836]

fileName = [MNISTInfo.outputFolderTrainingSetLabels];
disp(['Now reading from ', fileName]) %[output:9832e29d]
safeAddPath(fileName); %[output:48268f2d]
fileName = [fileName, '/', fileName]; % Append the file name with the lower-level file name
%%
% Diagnostics block for the Training Set Labels
% TRY, CATCH block to assert:
% 1. Magic Number (asserts it is equal to Training Set Labels identifier of 2049)
% 2. Number of items (labels)
% 3/4. Max/Min values in the labels are 0 <= x <= 9.
% with unique, value-embedded cause messages:

try
    % Syntax: baseException = MException(errID, msg);
    baseException = MException('Validation:HeaderCheckFailed', ...
        'One or more header values failed validation.');

    permission = 'r';
    machinefmt = 'b';

    fileID = fopen(fileName, permission, machinefmt); % Opens the file

    % Variables to be asserted
    magicNumber = fread(fileID, 1, 'int32'); % S/B: 2049 for Training Set Labels
    numItems = fread(fileID, 1, 'int32'); % S/B: 60,000, same as number of images.
    % Create an array to hold the image labels:
    TrainingSetLabels = uint8(zeros(numItems,1)); % Initialize; numItems (60k) rows by 1 column, 
    % unsigned 8-bit integer, meaning: 2^8 = 256 possible combinations, or
    % a range of values from 0 to 255.
    for k=1:numItems
        TrainingSetLabels(k) = fread(fileID,1,'uint8'); % Every iteration stores the label in a row as an 8-bit unsigned integer.

        % Display progress:
        if(mod(k,samplesBetweenDiagnostics)==0) % Use the MODULO OPERATION; when k = samplesBetweenDiagnostics, then the remainder after division is zero and thefore this triggers the "hard stop".
            disp([num2str(k/numItems*100), '% complete'])
        end
    end

    % Assertions

    % Assertion 1: Magic Number
    try
        assert(magicNumber == 2049, ...
            'Validation:InvalidMagicNumber', ...
            ['Magic number mismatch: Expected 2049 for training label file, but received ', ...
            num2str(magicNumber), '.']);
    catch cause1
        baseException = addCause(baseException, cause1);
    end
    % Assert syntax: assert(condition, errID, msg);

    % Assertion 2: Number of Items
    try
        assert(numItems == 60000, ...
            'Validation:UnexpectedItemCount', ...
            ['Item count mismatch: Expected 60,000 labels, but received ', ...
            num2str(numItems), '.']);
    catch cause2
        baseException = addCause(baseException, cause2);
    end
    % Throw exception if assertion fails.
    if ~isempty(baseException.cause)
        throw(baseException);
    else
        disp('✅ Header values and number of labels passed validation.');
    end

    % Assertion 3: Max value in the labels array.
    try
        assert(max(TrainingSetLabels(:)) <= 9, ...
            'MNIST:LabelOverFlow', ...
            ['Label exceeds range: Maximum value found was ', ...
            num2str(max(TrainingSetLabels(:))), '. Expected maximum is 9.']);
    catch cause3
        baseException = addCause(baseException, cause3);
    end
    % Assertion 4: Min value in the labels array.
    try
        assert(min(TrainingSetLabels(:)) >= 0, ...
            'MNIST:LabelUnderFlow', ...
            ['Label exceeds range: Minimum value found was ', ...
            num2str(min(TrainingSetLabels(:))), '. Expected minimum is 0.']);
    catch cause4
        baseException = addCause(baseException, cause4);
    end
    % Throw exception if assertion fails.
    if ~isempty(baseException.cause)
        throw(baseException);
    else
        disp('✅ All label values are within the valid range of 0 to 9.');
    end

    fclose(fileID);

catch ME
    % Display full error report, including all causes
    warning(ME.message)
    fclose(fileID);

    disp('❌ Validation Error Encountered:');
    disp(getReport(ME, 'extended')); % Gets the error message for an exception and
    % returns it as formatted text, 'extended' type includes the line number, 
    % error message, cause, and stack summary.
end
